import React from "react";

const Card =({name, type, season})=>{
    
    
    return(
        <div className="tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5"> 
            <img alt="Veggie image" src={`vegetables/${name}.png`} width={200} ></img>
            <div>
                <h2>{name}</h2>
                <h3>Type:</h3>
                <p>{type}</p>
                <h3>Season:</h3>
                <p className="mw5">{season}</p>
            </div>
        </div>
    );
}


export default Card;
